INSERT INTO `block_custom` VALUES (1,'<a href=\"http://localhost/tweeq/?q=node/add/tweet_scheduler/\">Schedule A Tweet</a>\r\n<a href=\"http://localhost/tweeq/?q=tweets/\">Your Tweets</a>','w','full_html'),(2,'<h1><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:26px\">TweetQ is a website to schedule your tweets and send them accordingly.</span></span></h1>\r\n\r\n<h1><strong>What you can do with TweetQ?</strong></h1>\r\n\r\n<blockquote>\r\n<ul>\r\n	<li>\r\n	<h2><strong>Write a new tweet</strong></h2>\r\n	</li>\r\n	<li>\r\n	<h2><strong>Fetch old tweets from your account</strong></h2>\r\n	</li>\r\n	<li>\r\n	<h2><strong>Build a queue for the fetched tweets</strong></h2>\r\n	</li>\r\n	<li>\r\n	<h2><strong>Post the tweets immediately</strong></h2>\r\n	</li>\r\n	<li>\r\n	<h2><strong>Schedule the tweets at a specific time&nbsp;</strong></h2>\r\n	</li>\r\n</ul>\r\n</blockquote>\r\n\r\n<p>&nbsp;</p>\r\n','front page','full_html');
