DROP TABLE IF EXISTS `twitter_db`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `twitter_db` (
  `tid` decimal(20,0) unsigned NOT NULL DEFAULT '0' COMMENT 'Twitter ID.',
  `created` int(11) DEFAULT NULL COMMENT 'Date and time when the tweet was created.',
  `text` varchar(500) DEFAULT NULL COMMENT 'Tweet text.',
  `source` varchar(500) DEFAULT NULL COMMENT 'Source.',
  `replyto` varchar(100) DEFAULT NULL COMMENT 'Reply to screen name.',
  `name` varchar(50) DEFAULT NULL COMMENT 'The user name or hashtag.',
  `type` varchar(20) DEFAULT NULL COMMENT 'User och hashtag.',
  `user_id` int(11) DEFAULT NULL COMMENT 'User ID.',
  `user_name` varchar(50) DEFAULT NULL COMMENT 'User name.',
  `user_profile_pic` varchar(300) DEFAULT NULL COMMENT 'URL to user profile picture on Twitter.',
  PRIMARY KEY (`tid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Used to store tweets.';
/*!40101 SET character_set_client = @saved_cs_client */;

